import './ServiceCard.css';
import Image from '/src/img/banner_1.jpg';


function ServiceCard(props) {

    return (
        <div className="serviceContainer" style={{back}}>
            <div className="card center">
                <div className="front">
                </div>
                <div className="back">
                    <div className="back-content center">
                        <h2>{props.title}</h2>
                        <span>Подпишись на канал!</span>
                        <span>и ставьте</span>
                    </div>
                </div>
            </div>
        </div>


    );
}

export default ServiceCard;
